import React from 'react'


const Table2 = ({ data }) => {
  return (
    <div style={{ display: 'flex', flexWrap: 'wrap' }}>
      {data.map((item) => (
        <div key={item.id} style={{ flexBasis: '25%', justifyContent: 'flex-start', padding: 10 }}>
          <img src={item.imageSrc} alt={`${item.first_name}`} style={{ width: '20%', height: 'auto' }} />
        </div>
      ))}
    </div>
  );
};
  
  export default Table2;
